import Slider from "../../components/Carousel/carousel";
import Presta from "../Presta/presta.tsx";
import Aboutme from "../Aboutme/aboutme.tsx";
import Instacontact from "../Instacontact/instacontact.tsx";
import Footer from "../../components/Footer/footer.tsx";
import { ConsentBanner, ConsentProvider } from 'react-hook-consent';

const Home = () => {
  return (
    <div>
      <CookieConsent
        location="bottom"
        buttonText="Sure man!!"
        cookieName="myAwesomeCookieName2"
        style={{ background: "#2B373B" }}
        buttonStyle={{ color: "#4e503b", fontSize: "13px" }}
        expires={150}
      >
        Ce site web utilise des cookies pour améliorer l'expérience utilisateur.{" "}
        <span style={{ fontSize: "10px" }}>This bit of text is smaller :O</span>
        enableDeclineButton onDecline=
        {() => {
          alert("nay!");
        }}
      </CookieConsent>
      <Slider />
      <Presta />
      <Aboutme />
      <Instacontact />

      <Footer />
    </div>
  );
};

export default Home;
